import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import 'tachyons';
import {nbaPlayers} from './nbaPlayers';

import * as serviceWorker from './serviceWorker';

// ReactDOM.render(<App />, document.getElementById('root'));

ReactDOM.render(
   <div>
      <Card rank={nbaPlayers.rank[0]} name={nbaPlayers.name[0]} team={nbaPlayers.team[0]} />
      <Card rank={nbaPlayers.rank[1]} name={nbaPlayers.name[1]} team={nbaPlayers.team[1]} />
      <Card rank={nbaPlayers.rank[2]} name={nbaPlayers.name[2]} team={nbaPlayers.team[2]} />
   </div>
   , document.getElementById('root'));



// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
